INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 7001, 1, "キャル", 7, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 7002, 1, "コッコロ", 7, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 7003, 1, "ペコリーヌ", 7, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 10001, 1, "ペコリーヌ", 10, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 10002, 1, "キャル", 10, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 10003, 1, "コッコロ", 10, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 10004, 1, "シェフィ", 10, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 12001, 1, "ペコリーヌ", 12, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 13001, 1, "キャル", 13, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 13002, 1, "コッコロ", 13, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 13003, 1, "シェフィ", 13, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 13004, 1, "ペコリーヌ", 13, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 14001, 1, "コッコロ", 14, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 14002, 1, "シェフィ", 14, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 14003, 1, "ペコリーヌ", 14, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 14004, 1, "キャル", 14, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 15001, 1, "コッコロ", 15, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 16001, 1, "シェフィ", 16, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 16002, 1, "ペコリーヌ", 16, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 16003, 1, "キャル", 16, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 16004, 1, "コッコロ", 16, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 17002, 1, "コッコロ", 17, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 17004, 1, "キャル", 25, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 17005, 1, "コッコロ", 25, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 17006, 1, "シェフィ", 25, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 17007, 1, "ペコリーヌ", 25, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 18001, 1, "カリン", 18, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 18002, 1, "カリン", 18, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 2, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 19001, 1, "カリン", 19, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 3, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 19002, 1, "カリン", 19, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 4, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 20001, 1, "カリン", 20, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 5, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 20002, 1, "カリン", 20, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 6, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 21001, 1, "キャル", 21, 0.0, 0.0, 1, "2030/12/17 14:59:59", 106001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 21002, 1, "コッコロ", 21, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105901, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 21003, 1, "シェフィ", 21, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 21004, 1, "ペコリーヌ", 21, 0.0, 0.0, 1, "2030/12/17 14:59:59", 105801, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 22001, 1, "カリン", 22, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 1, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 22002, 1, "カリン", 22, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 2, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 23001, 1, "カリン", 23, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 3, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 23002, 1, "カリン", 23, 0.0, 0.0, 1, "2030/12/17 14:59:59", 190801, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 4, "2015/12/17 15:00:00", 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24001, 2, "エリコ（バレンタイン）", 24, 8.0, 4.08, 1, "2030/12/17 14:59:59", 109001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 1, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24002, 2, "エリコ（バレンタイン）", 24, 8.0, 5.0, 1, "2030/12/17 14:59:59", 109001, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 2, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24003, 2, "エリコ（バレンタイン）", 24, 8.0, 10.11, 1, "2030/12/17 14:59:59", 109001, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 3, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24004, 2, "エリコ（バレンタイン）", 24, 8.0, 4.0, 1, "2030/12/17 14:59:59", 109001, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 4, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24005, 2, "エリコ（バレンタイン）", 24, 8.0, 6.0, 1, "2030/12/17 14:59:59", 109001, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 5, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24006, 1, "エリコ（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109002, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 6, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24007, 1, "エリコ（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109002, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 7, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24008, 1, "エリコ（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109002, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 8, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24009, 1, "エリコ（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109002, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 9, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24010, 1, "エリコ（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109002, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 10, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24011, 2, "シズル（バレンタイン）", 24, 8.0, 2.12, 1, "2030/12/17 14:59:59", 109101, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 1, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24012, 2, "シズル（バレンタイン）", 24, 8.0, 4.19, 5, "2030/12/17 14:59:59", 109101, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 2, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24013, 4, "シズル（バレンタイン）", 24, 8.0, 2.3, 2, "2030/12/17 14:59:59", 109101, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 3, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24014, 1, "シズル（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109102, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 4, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24015, 2, "シズル（バレンタイン）", 24, 8.0, 5.23, 5, "2030/12/17 14:59:59", 109101, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 5, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24016, 1, "シズル（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109102, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 6, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24017, 2, "シズル（バレンタイン）", 24, 8.0, 5.01, 1, "2030/12/17 14:59:59", 109101, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 7, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24018, 1, "シズル（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109102, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 8, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24019, 1, "シズル（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109102, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 9, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (0, 24020, 1, "シズル（バレンタイン）", 24, 0.0, 0.0, 1, "2030/12/17 14:59:59", 109102, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 10, "2019/01/31 12:00:00", 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2104010, 26001, 1, "シェフィ", 26, 0.0, 0.0, 2, "2030/12/17 14:59:59", 106401, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 1, "2015/12/17 15:00:00", 0);
